import React from 'react';
import Header from '../components/Header';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import EventCard from '../components/EventCard';

const Home = () => {
    const featuredEvents = [
        {
            title: 'Rust Tournament 2023',
            date: 'June 15, 2023',
            description: 'Join us for the annual Rust Tournament where players compete for glory and prizes!'
        },
        {
            title: 'Rust Community Meetup',
            date: 'July 20, 2023',
            description: 'A gathering for Rust enthusiasts to share strategies and experiences.'
        },
        {
            title: 'Rust Game Development Workshop',
            date: 'August 10, 2023',
            description: 'Learn how to develop games using Rust with industry experts.'
        }
    ];

    return (
        <div>
            <Header />
            <Navbar />
            <main>
                <h1>Welcome to Rustaco Eventos</h1>
                <p>Your go-to organization for competitive Rust tournaments and events.</p>
                <h2>Featured Events</h2>
                <div className="event-list">
                    {featuredEvents.map((event, index) => (
                        <EventCard key={index} title={event.title} date={event.date} description={event.description} />
                    ))}
                </div>
            </main>
            <Footer />
        </div>
    );
};

export default Home;
